import React, { Component } from 'react'
import axios from 'axios';

export class CarListItem extends Component {


    state = {
        carID : this.props.car.id
    } 
    getButtonStyle = () => {
        return {
        padding: "10px",
        textAlign: "center",
        width: "50%",
        fontSize: "14px",
        fontWeight: "bold",
        background: "#de1111",
        border: "none"
        }
    }
    deleteCar = () => {
        axios.delete('https://autorentserver.azurewebsites.net/api/cars/remove/'+ this.state.carID.toString(),{headers: {
            'Content-Type': 'application/json',
            'auth-token': this.props.userdata.authToken
        }})
        .then((res) => {
            console.log(res.data)
            window.location.reload()
         })
         .catch(err => {
             console.log(err)
         });

    }



    render() {
        return (

            <tr key={this.props.car.id}>
               <td>{this.props.car.carBrandName}</td>
               <td>{this.props.car.carModelName}</td>
               <td>{this.props.car.color}</td>
               <td>{this.props.car.fuel}</td>
               <td>{this.props.car.gearBox}</td>
               <td>{this.props.car.country}</td>
               <td>{this.props.car.carName}</td>
               <td> 
                   <button style={this.getButtonStyle()}
                        onClick={() => this.deleteCar()}>
                        Usu≈Ñ
                   </button>
               </td>
            </tr>
        )
    }
}

export default CarListItem
